import React, { useState, useEffect } from 'react';
import Axios from 'axios';

function Home() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/vehicles/')
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle data:', error);
      });
  }, []);

  return (
    <div className="container mt-5">
      <h1 className="text-center">Vehicle Listings</h1>
      <div className="row">
        {vehicles.map((vehicle) => (
          <div key={vehicle.id} className="col-md-4 mb-4">
            <div className="card">
              <img src={vehicle.image} className="card-img-top" alt="Vehicle" />
              <div className="card-body">
                <h5 className="card-title">{vehicle.make} {vehicle.model}</h5>
                <p className="card-text">
                  <strong>Vehicle Type:</strong> {vehicle.vehicle_type}
                  <br />
                  <strong>Year:</strong> {vehicle.year}
                  <br />
                  <strong>Phone Number:</strong> {vehicle.phone_number}
                  <br />
                  <strong>Price:</strong> {vehicle.price}
                </p>
                <p className="card-text"><strong>Description:</strong> {vehicle.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
